import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import L from "leaflet";
import "leaflet/dist/leaflet.css";
import axios from "axios";
import "./MapView.css";

// Fix default icon issue in Leaflet
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl:
    "https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon-2x.png",
  iconUrl:
    "https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon.png",
  shadowUrl:
    "https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-shadow.png",
});

export default function MapView() {
  const [places, setPlaces] = useState([]); // All places from backend
  const [filteredPlaces, setFilteredPlaces] = useState([]);
  const [search, setSearch] = useState("");
  const [filters, setFilters] = useState({
    lift: false,
    ramp: false,
    toilet: false,
  });

  // Fetch places from backend
  useEffect(() => {
    async function fetchPlaces() {
      try {
        const res = await axios.get("http://localhost:3001/places"); // your API endpoint
        setPlaces(res.data.places);
        setFilteredPlaces(res.data.places);
      } catch (err) {
        console.error("Error fetching places:", err);
      }
    }
    fetchPlaces();
  }, []);

  // Update filteredPlaces whenever search or filters change
  useEffect(() => {
    let filtered = places;

    // Apply search filter
    if (search.trim() !== "") {
      filtered = filtered.filter((p) =>
        p.name.toLowerCase().includes(search.toLowerCase())
      );
    }

    // Apply accessibility filters
    const activeFilters = Object.entries(filters)
      .filter(([key, value]) => value)
      .map(([key]) => key);

    if (activeFilters.length > 0) {
      filtered = filtered.filter((p) =>
        activeFilters.every((f) => p.accessibility?.[f])
      );
    }

    setFilteredPlaces(filtered);
  }, [search, filters, places]);

  // Handle search input change
  const handleSearch = (e) => setSearch(e.target.value);

  // Handle accessibility filter toggle
  const handleFilterChange = (e) => {
    const { name, checked } = e.target;
    setFilters((prev) => ({ ...prev, [name]: checked }));
  };

  return (
    <div className="map-view-container">
      {/* Search bar */}
      <div className="search-bar">
        <input
          type="text"
          placeholder="Search places..."
          value={search}
          onChange={handleSearch}
        />
      </div>

      {/* Accessibility filters */}
      <div className="filters">
        <label>
          <input
            type="checkbox"
            name="lift"
            checked={filters.lift}
            onChange={handleFilterChange}
          />
          Lift
        </label>
        <label>
          <input
            type="checkbox"
            name="ramp"
            checked={filters.ramp}
            onChange={handleFilterChange}
          />
          Ramp
        </label>
        <label>
          <input
            type="checkbox"
            name="toilet"
            checked={filters.toilet}
            onChange={handleFilterChange}
          />
          Toilet
        </label>
      </div>

      {/* Map */}
      <MapContainer
        center={[23.589, 58.382]} // Default coordinates (Oman)
        zoom={12}
        style={{ height: "70vh", width: "100%" }}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution="&copy; OpenStreetMap contributors"
        />

        {filteredPlaces.map((place) => (
          <Marker key={place._id} position={[place.lat, place.lng]}>
            <Popup>
              <h3>{place.name}</h3>
              {place.accessibility ? (
                <ul>
                  {place.accessibility.lift && <li>Lift ✅</li>}
                  {place.accessibility.ramp && <li>Ramp ✅</li>}
                  {place.accessibility.toilet && <li>Accessible Toilet ✅</li>}
                </ul>
              ) : (
                <p>No accessibility info</p>
              )}
              <p>{place.address || ""}</p>
            </Popup>
          </Marker>
        ))}
      </MapContainer>
    </div>
  );
}
